import React from 'react';

const Footer = () => {
    return (
        <footer>
            <p>&copy; 2024 MazWakes. All Rights Reserved.</p>
            <div>
                <a href="/terms">Terms of Service</a>
                <a href="/privacy">Privacy Policy</a>
            </div>
        </footer>
    )
};

export default Footer;
